import React, { Component } from "react";
import { Button, Card } from "react-bootstrap";

class Cards extends Component {
  render() {
    return (
      <div>
        <Card
          style={{ width: "50%", height: "50rem", background: "red" }}
        ></Card>
      </div>
    );
  }
}

export default Cards;
